import React from 'react';
import classNames from 'classnames';
import styles from './Personal.module.scss';

const {
  container,
  textWrapper,
  imageWrapper,
  portrait,
  background,
  paragraph,
  h2,
} = styles;

const Personal = () => {
  return (
    <div className={container}>
      <div className={textWrapper}>
        <h3 className={h2}>On the personal notes</h3>
        <p className={paragraph}>
          My name is Sigrún Dís Hauksdóttir and I am from Reykjavík, the capital
          of Iceland. Currently I am living in Denmark studying for my master’s
          degree at the University of Southern Denmark. I have really diverse
          interests. From sitting in a relaxed environment doing something
          creative to attending outdoor activities which increases the
          adrenaline. I am adventurous person who loves to travel, practise
          sports, and one of the most fun things I do is snowboarding. I am also
          really social, therefore I love working in a team consisting of
          diverse people. When it comes to planning something for social life I
          am often quick to volunteer because I find it really entertaining.
        </p>
      </div>
      <div className={imageWrapper}>
        <div className={background}></div>
        <div className={portrait}></div>
      </div>
    </div>
  );
};

export default Personal;
